function initScript(){
    let grade = '1학년';
    setGradeData(grade);

    // const tabs = document.querySelectorAll('.tab');
    // _.each(tabs, tab => {
    //     tab.addEventListener('click', tabHandler);
    // });

    function tabHandler(item) {
        const tabTarget = item.currentTarget;
        _.each(tabs, tab => {
            tab.classList.remove("active");
        });

        tabTarget.classList.add("active");
        setGradeData(tabTarget.innerText);
    }
}

function setGradeData(grade) {
    const gradeData = _.filter(data, (row) => row.cur_name.indexOf(grade) > -1);
    const _data = _.groupBy(gradeData, 'cur_name');
    let container = document.querySelector('.container');
    let classInner = container.querySelector('.class-inner');
    classInner.innerHTML = '';

    for(let key in _data) {
        let html = '<div class="class-wrap"><h2>' + key.replace("부흥고_", "").replace(grade, '') + '</h2>';
        html += '<div class="chatbot-list">';
        _.each(_data[key], (row) => {
            if(row.chatbot_id) {
                html += '<div class="item">';
                // html += '<p>' + row.username.slice(row.username.length-2) + '번 학생</p>';
                html += '<div class="img"><img src="' + row.image_url+ '"/></div>'
                html += '<b>' + row.chatbot_name + '</b>';
                html += '<a href="https:\/\/frogue.ailearn.co.kr/?chatbot_id='+ row.chatbot_id + '" target="_blank">대화하기</a>'
                html += '</div>';
            }
        });

        html += '</div>';
        classInner.insertAdjacentHTML('beforeend', html);
    }
    container.appendChild(classInner);
}

(function(){
    initScript();
}());

